import React from 'react';
import { Slider } from '../../components/Slider/Slider';

import "./Main.css";

const Main = () => {
  let timezone = new Date().getTimezoneOffset();
  return (
    <div>
      <Slider />
      <div className=''>
        <p>{timezone}</p>
      </div>

    </div>
  );
};

export default Main;
